    false,nt"url": null,nt"notes": "This dataset is one component of a digital
    orthophoto coverage (DOI) over the Southwest Florida Water Management District (SWFWMD)
    area. This dataset is comprised of 4-band stack 32bit (red, green, blue and infrared
    bands) DOI cells in a Geotiff format, at a 1-foot pixel resolution, based on the
    District's 5,000' x 5,000' tile system. This dataset was created from source imagery
    acquired through the Leica ADS40 multispectral scanner from December 17, 2007 through
    January 28, 2008. The companion dataset to this coverage includes a dataset comprised
    of the original imagery mosaic lines with dates of imagery acquisition in the ESRI
    shapefile format.",nt"license_title": null,nt"extras": [{ntt"key":
